const e=JSON.parse('{"key":"v-8397ce6c","path":"/zh/essay/restful.html","title":"restful","lang":"zh-CN","frontmatter":{"category":[],"tag":[],"title":"restful"},"headers":[{"level":3,"title":"restful定义","slug":"restful定义","link":"#restful定义","children":[]},{"level":3,"title":"幂等性","slug":"幂等性","link":"#幂等性","children":[]},{"level":3,"title":"restful Api","slug":"restful-api","link":"#restful-api","children":[]},{"level":3,"title":"参考 :","slug":"参考","link":"#参考","children":[]}],"git":{"createdTime":1684677761000,"updatedTime":1684677761000,"contributors":[{"name":"wangruifei","email":"670635964@qq.com","commits":1}]},"readingTime":{"minutes":3.31,"words":993},"filePathRelative":"zh/essay/restful.md","localizedDate":"2023年5月21日","excerpt":"<h3> restful定义</h3>\\n<ul>\\n<li>\\n<p>REST（Representational State Transfer）是一种设计风格，用于构建网络应用程序。它提供了一组规则和指南，帮助开发人员创建可扩展的、结构化的 API（应用程序编程接口）。</p>\\n</li>\\n<li>\\n<p>RESTful API 就是遵循 REST 设计原则构建的 API。这些原则包括：</p>\\n</li>\\n<li>\\n<p>使用 HTTP 协议的标准方法（例如 GET、PUT、POST 和 DELETE）来操作资源。\\n使用资源的 URI 来唯一地标识它。\\n使用网络上的标准协议（例如 HTTP、FTP 等）来传输数据。\\n使用 XML、JSON 等格式来表示资源。\\n遵循 REST 设计原则可以使 API 更简单、可扩展、易于理解，也更易于实现。</p>\\n</li>\\n</ul>"}');export{e as data};
